angular.module('templates').run(['$templateCache', function($templateCache) {$templateCache.put('ui/widgets/dnsim-item-link.html','<a class="{{item.rank.name}}-grade text-left" ng-href="{{itemLink}}"><dnsim-item-icon item="item" style="float: left"></dnsim-item-icon><span ng-if="item.enchantmentNum > 0">+{{item.enchantmentNum}}<span ng-if="item.typeName == \'talisman\'">%</span> </span><span ng-if="item.levelLimit > 1">lv{{item.levelLimit}}</span> {{item.name}}</a>');}]);